@AlDanial btw I finally got to know why I had this issue and you never encountered it :
the behavior described in https://github.com/AlDanial/cloc/issues/849#issuecomment-2301993628 only applies when Developer mode is enabled on the Windows settings. What does it changes ?
✅ Enabled : WinGet only adds %LOCALAPPDATA%\Microsoft\WinGet\Links to the PATH and create symlinks for each portable app ❌ Disabled : Winget adds every single portable app's path individually to the PATH (ex : %LOCALAPPDATA%\Microsoft\WinGet\Packages\AlDanial.Cloc_Microsoft.Winget.Source_8wekyb3d8bbwe )
